        $.fn.simpleSpy = function() {
            limit = 5;
            return this.each(function() {
                var $list = $(this),
                    running = true,
                    items = [],
                    currentItem = 9;
                $list.find('> li').each(function() {
                    items.push('<li>' + $(this).html() + '</li>');
                });
                $list.find('> li').filter(':gt(' + (limit - 1) + ')').remove();
                $list.bind('stop', function() {
                    running = false;
                }).bind('start', function() {
                    running = true;
                });

                function spy() {
                    if (running) {
                        var $insert = $(items[currentItem]).css({
                            height: 0,
                            opacity: 0
                        }).prependTo($list);
                        $list.find('> li:last').animate({
                            opacity: 0
                        }, 0, function() {
                            $(this).animate({
                                height: 0
                            }, 0, function() {
                                $(this).remove();
                            });
                        });
                        $insert.animate({
                            opacity: 1
                        }, 1).animate({
                            height: 33
                        }, 500);
                        currentItem--;
                        if (currentItem < 0) {
                            currentItem = 9;
                        }
                    }
                    setTimeout(spy, 4500);
                }
                spy();
            });
        };

        function parallax(el, speed, reverse, rotate, horizontal) {
            var viewport = $(window),
                scrollPos = viewport.scrollTop();
            if (rotate == false && horizontal == false) {
                if (reverse == false) {
                    el.css('transform', 'translateY(' + scrollPos / speed + 'px)');
                } else {
                    el.css('transform', 'translateY(' + -scrollPos / speed + 'px)');
                }
            } else if (horizontal == false) {
                el.css('transform', 'rotate(-' + scrollPos / speed + 'deg)');
            } else if (horizontal == true) {
                el.css('transform', 'translateX(' + -scrollPos / speed + 'px)');
            }
        }
        if ($(window).width() >= 992) {
